public class InnerChannelAvailSettingsFactory(Action<Humidifier.MediaLive.ChannelTypes.AvailSettings> factoryAction = null) : SubResourceFactory<Humidifier.MediaLive.ChannelTypes.AvailSettings>
{

    internal InnerChannelScte35SpliceInsertFactory Scte35SpliceInsertFactory { get; set; }

    internal InnerChannelScte35TimeSignalAposFactory Scte35TimeSignalAposFactory { get; set; }

    internal InnerChannelEsamFactory EsamFactory { get; set; }

    protected override Humidifier.MediaLive.ChannelTypes.AvailSettings Create()
    {
        var availSettingsResult = CreateAvailSettings();
        factoryAction?.Invoke(availSettingsResult);

        return availSettingsResult;
    }

    private Humidifier.MediaLive.ChannelTypes.AvailSettings CreateAvailSettings()
    {
        var availSettingsResult = new Humidifier.MediaLive.ChannelTypes.AvailSettings();

        return availSettingsResult;
    }
    public override void CreateChildren(Humidifier.MediaLive.ChannelTypes.AvailSettings result)
    {
        base.CreateChildren(result);

        result.Scte35SpliceInsert ??= Scte35SpliceInsertFactory?.Build();
        result.Scte35TimeSignalApos ??= Scte35TimeSignalAposFactory?.Build();
        result.Esam ??= EsamFactory?.Build();
    }

} // End Of Class

